                    <p className='text-[18px] font-[Poppins] text-justify'>As a person I look for deeper meaning in all the things that exist or happen. I want to keep evolving
and discovering the infinite potential within me . My life's purpose is to create extraordinary things
which exceed my imagination. My love for creating “ the extraordinary ” stems from my deep
appreciation for artistic expression.

Art is
my muse, and through fashion, I strive to make it wearable and accessible to all.</p>
